import { Link } from "react-router-dom";
import { Table } from "react-bootstrap";
import "./Owner.css";
import Ownernav from "./Ownernav";
import { useEffect, useState } from "react";
import { API_GET } from "../../api";




export default function Order() {
    let pages = 5;

    const [list,setList] = useState([]);

    useEffect(() =>{
        async function fetchData(){
            let json = await API_GET("order/getallorder");
            setList(json.data);

        }
        fetchData()
    })

    return (
        <>
            <div className='container-fluid  '>
                <div className='row'>
                    <div className="col-lg-2 p-0  sidebar" >
                        <Ownernav pages={pages} />
                    </div>

                    <div className="col-lg-10 p-0 title content"><br></br>
                        <h1><center>คำสั่งซื้อ</center></h1><br></br>
                        <div className="col-2">
                        </div>
            
                        <div className='row mt-1 '>
                            <div className='col text-center'>
                                <Table striped>
                                    <thead className="frame3  text-white">
                                        <tr>
                                            <th>หมายเลขคำสั่งซื้อ</th>
                                            <th>แฟรนไชส์</th>
                                            <th>วันที่สั่งซื้อ</th>
                                            <th>ยอดเงินรวม</th>
                                            <th>สถานะ</th>

                                        </tr>
                                    </thead>

                                </Table>
                            </div>
                        </div>


                </div>
            </div>
        </div>
        </>
    )
}
